import React from "react";
import { StyleSheet, Text, View } from "react-native";

export default function Hooks() {
    return (
        <View style={styles.container}>
            <Text>Hello World</Text>
        </View>
    )
}

const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'center',
    },
  
    textStyle: {
      color: "red",
      margin: 20,
      fontSize: 25,
    }
  });
